import React, { useState } from "react";
import {View,Text,FormControl,Input,InputField,Button,ButtonText,} from "@gluestack-ui/themed";

import { useFormik } from "formik";
import {initialValues} from "./RegisterForm.data";


const Register = () => {

  const formik = useFormik({
    initialValues: initialValues(),
    // validationSchema: validationSchema(),
    onSubmit: (formValue) => {
      console.log("Formulario enviado");
      console.log(formValue);
    },
  });

  return (
    <View>

      <Input
        variant="outline"
        size="md"
        isDisabled={false}
        isInvalid={false}
        isReadOnly={false}
        
      >
        <InputField placeholder="Email" type="text"
        onChangeText={(text) => formik.setFieldValue("email", text)}/>
      </Input>

        <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
              <InputField
                type="text"
                placeholder="Email"
                backgroundColor="white"
                onChangeText={(text) => formik.setFieldValue("email", text)}
              />
            </Input>

      <Button onPress={formik.handleSubmit}>
        <Text>
          Iniciar sesion
        </Text>
      </Button>

    </View>
  );
};
export default Register;
